import axios from 'axios'

const api = axios.create({
    baseURL: 'http://localhost:3000/api',
})

export const insertMember = payload => api.post(`/movie`, payload)
export const getAllMembers = () => api.get(`/movies`)
export const updateMemberById = (id, payload) => api.put(`/movie/${id}`, payload)
export const deleteMemberById = id => api.delete(`/movie/${id}`)
export const getMemberById = id => api.get(`/movie/${id}`)

const apis = {
    insertMember,
    getAllMembers,
    updateMemberById,
    deleteMemberById,
    getMemberById,
}

export default apis
